  false,\n\t\"url\": null,\n\t\"notes\": \"The aquatic habitat available for sportfishing
  on St. Vincent National Wildlife Refuge consists of six fresh water lakes totaling
  272 acres of water. Fishery management efforts will be directed towards enhancing
  and maintaining the sportfishery in these pools. Native warmwater fish species provided
  by the Service's National Fish Hatchery System will be utilized in supplementing,
  managing and enhancing the sport fishery. The purpose of this plan is to outline
  goals and objectives in managing the fishery resource in relation to the Refugeu2019s
  primary objective.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
